sources.styles/blocks/swiper.scss:
.swiper {
  width: 100%;
  height: 340px;
  @include onTablet {
    display: none;
  }
  &--2 {
    display: block;
    height: 372px;
    @include onDesktop {
      display: none;
    }
  }
  &-button {
    &-prev--custom {
      right: 50%;
      @include onTablet {
        right: initial;
        left: 0;
      }
    }
    &-next--custom {
      left: 50%;
      @include onTablet {
        left: 45px;
      }
    }
    &-prev--custom,
    &-next--custom {
      position: absolute;
      bottom: 34px;
      z-index: 1;
      cursor: pointer;
      &:hover {
        fill: $c-swiper;
      }
    }

    &-disabled {
      fill: $c-light-grey;
      &:hover {
        fill: $c-dark;
      }
    }
  }
  &-pagination {
    &--custom {
      bottom: 0 !important;
      font-size: 11px;
      line-height: 13px;
      color: $c-swiper;
      @include onTablet {
        width: max-content !important;
        left: 20px !important;
      }
    }
    &-current {
      position: relative;
      bottom: 5px;
      font-size: 16px;
      color: $c-dark;
    }
  }
}

