sources.styles/blocks/about.scss:
.about {
  overflow-x: hidden;
  @media (min-width: 220px) {
    height: 1460px;
  }
  @include onTablet {
    height: 960px;
  }
  &__article {
    position: relative;
    margin-bottom: 110px;
    @include onTablet {
      margin-bottom: 200px;
    }
    &:last-of-type {
      margin-bottom: 0;
    }
  }
  &__img {
    width: 100%;
    height: 100%;
    display: block;
    padding-bottom: 20px;
    object-fit: cover;
    object-position: center;
    transition: transform $transition-duration;
    @include onTablet {
      margin-bottom: 0;
      padding: 0 10px 20px;
    }
    @include onDesktop {
      &:hover {
        transform: scale(110%);
      }
    }
  }
  &__img-container {
    overflow: hidden;
    @include onTablet {
      position: absolute;
      top: 0;
      height: 415px;
    }
    @include onDesktop {
      left: 0;
      height: 388px;
    }
    &--luna {
      @include onTablet {
        left: unset;
        right: 0;
      }
    }
  }
  &__title {
    margin-bottom: 30px;
    font-weight: 700;
    font-size: 30px;
    line-height: 40px;
    text-transform: uppercase;
    @include onTablet {
      font-size: 36px;
      line-height: 46px;
    }
    @include onDesktop {
      font-size: 56px;
      line-height: 70px;
      margin-bottom: 0;
    }
  }
  &__description {
    font-weight: 400;
    color: $c-dark-grey;
    margin-bottom: 30px;
    font-size: 14px;
    line-height: 21px;
    @include onTablet {
      margin-bottom: 60px;
      font-size: 16px;
      line-height: 24px;
      // padding: 0 20px;
    }
  }
  &__link {
    font-weight: 700;
    font-size: 12px;
    line-height: 14px;
    text-transform: uppercase;
    color: $c-acent;
    position: relative;
    padding-bottom: 5px;
    &::after {
      content: "";
      position: absolute;
      bottom: 0;
      display: block;
      width: 40%;
      height: 1px;
      background-color: $c-acent;
      transition: width $transition-duration;
    }
    &:hover {
      &::after {
        width: 100%;
      }
    }
  }
}

